import React from "react";
import "./CostItem.css";

function CostItem() {
  return (
    <div className="cost-item">
      <div>March 2021 12</div>
      <div className="cost-item_description">
        <h2>Refrigerator</h2>
      </div>
      <div className="cost-item_price">$ 999</div>
    </div>
  );
}

export default CostItem;
